import { LOGIN } from "./login";

const initialState = {
    email:"",
    name:"",
    password:""
}

const userReducer = (state = initialState, action) => {
    const test = Object.assign({}, initialState)
    test.email = action.payload?.email
    test.name = action.payload?.name
    switch (action.type) {
        case LOGIN:
            console.log(action)
            return {
                ...state,
                test
            }
        default: return state;
    }
}

export default userReducer
